import * as React from 'react'
import { View, Text, Image } from "react-native";
import { Card } from 'react-native-elements'



export const renderItem = (item:any) => {
    return (
        <Card>
        <View>
          <Image
            resizeMode="cover"
            source={{ uri: item.image }}
          />
          <Text>{item.title}</Text>
        </View>
      </Card>

    );
}
